import React, { useEffect, useState } from "react";
import axios from "axios";

const WrapperComponent = (Component) => {
  return class extends React.Component {
    render() {
      return (
        <div>
          <Component {...this.props} />
        </div>
      );
    }
  };
};

export default WrapperComponent;
